/*Table structure for table `codeworld_log` */

DROP TABLE IF EXISTS `codeworld_log`;

CREATE TABLE `codeworld_log` (
  `t_log_id` bigint(20) NOT NULL COMMENT '操作日志主键Id',
  `t_log_operation_username` varchar(255) DEFAULT NULL COMMENT '日志操作的用户名',
  `t_log_operation` varchar(255) DEFAULT NULL COMMENT '日志操作名称',
  `t_log_time` bigint(20) DEFAULT NULL COMMENT '操作时间',
  `t_log_method` varchar(255) DEFAULT NULL COMMENT '操作方法',
  `t_log_params` text COMMENT '操作参数',
  `t_log_ip` varchar(255) DEFAULT NULL COMMENT '操作IP',
  `t_log_location` varchar(255) DEFAULT NULL COMMENT '操作地点',
  `t_log_create_time` datetime DEFAULT NULL COMMENT '操作时间',
  PRIMARY KEY (`t_log_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

