/*Table structure for table `codeworld_login_log` */

DROP TABLE IF EXISTS `codeworld_login_log`;

CREATE TABLE `codeworld_login_log` (
  `t_login_log_id` bigint(20) NOT NULL COMMENT '登录日志主键Id',
  `t_login_log_name` varchar(255) DEFAULT NULL COMMENT '登录名',
  `t_login_log_time` datetime DEFAULT NULL COMMENT '登录时间',
  `t_login_log_location` varchar(255) DEFAULT NULL COMMENT '登录地点',
  `t_login_log_ip` varchar(255) DEFAULT NULL COMMENT '登录IP',
  `t_login_log_system` varchar(255) DEFAULT NULL COMMENT '登录系统',
  `t_login_log_browser` varchar(255) DEFAULT NULL COMMENT '登录浏览器类型',
  PRIMARY KEY (`t_login_log_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

